import { Menubar } from "primereact/menubar";

const Navbar = () => {
    const Navbar = () => {
        const items = [
          {
            label: "Home",
            icon: "pi pi-fw pi-home",
            url: "/"
          },
          {
            label: "Product",
            icon: "pi pi-fw pi-shopping-bag",
            url: "/product"
          },
          {
            label: "Contact",
            icon: "pi pi-fw pi-mobile",
            url: "/contact"
          },
          // {
