          //     },
          //     {
          //       label: "Settings",
          //       icon: "pi pi-fw pi-user-minus",
          //     },
          //   ],
          // },
        ];
       
      
       
      };
    return ( 
        <Menubar model={items} />
     );
}
 

export default Navbar;
